import './main.scss'
import { Navbar } from '../../components/navbar/navbar'
import { Block } from '../../components/block/block'

export const MainPage = () => {
  return (
    <div className="main">
      <Navbar />
      <Block title={'Календарь мероприятий'} color={'blue'} />
      <Block title={'Как добраться до Экспофорума'} color={'green'} />
      <Block
        title={'Онлайн-заявка на организацию мероприятия'}
        color={'yellow'}
      />
      <Block title={'План и инфраструктура комплекса'} color={'red'} />
    </div>
  )
}
